import React from 'react';
import {Form} from 'react';


export default Form = () => {


    return (
        <div id="form">

            <form class="email">
                <input type='text'
                    id="number"
                    placeholder="Enter your Email-id "
                    onChange={this.handleChange}
                />
                <div id="recaptcha-container"></div>
                <button type="button" onclick="MailSend();"> Send Mail </button>
            </form>

        </div>

    );

}
